class Routes{
	constructor(props) {
	  this.state = {}
		// add canals, uncomment to include canals like suez etc
		// for(var i=0; i<5; i++){
		//   worldArray[117+i][395-i] = 1;
		// }
		this.graph = new Graph(worldArray, {diagonal: true});

	}


	// Gets closest 1's index on Array
	closestSeaIndex=(i, j)=>{
	  var flag = false;
	  var counter = 1;

	  if(worldArray[i][j] == 1){
	    return [i, j];
	  }

	  while(!flag){
	    if(i+counter < worldArray.length && worldArray[i+counter][j] == 1){
	      return [i+counter, j];
	    }
	    else if(i-counter >= 0 && worldArray[i-counter][j] == 1){
	      return [i-counter, j];
	    }
	    else if(j+counter < worldArray[0].length && worldArray[i][j+counter] == 1){
	      return [i, j+counter];
	    }
	    else if(j-counter >= 0 && worldArray[i][j-counter] == 1){
	      return [i, j-counter];
	    }
	  }
	}

	// Converts coordinates to index
	getIndexOfCordinate=(coor)=>{
	  return [Math.round(coor[0])+90, Math.round(coor[1])+360];
	}

	// Returns route's array
	getRoute=(start, end)=>{
	  var startIndex = this.getIndexOfCordinate(start);
	  var endIndex = this.getIndexOfCordinate(end);
	  // console.log( this.graph.grid[startIndex[0]][startIndex[1]]);
	  return astar.search(this.graph, this.graph.grid[startIndex[0]][startIndex[1]], this.graph.grid[endIndex[0]][endIndex[1]]);
	}

	distance=({start, end, unit="km"})=>{
		//:::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::
		//:::                                                                         :::
		//:::  This routine calculates the distance between two points (given the     :::
		//:::  latitude/longitude of those points). It is being used to calculate     :::
		//:::  the distance between two locations using GeoDataSource (TM) products  :::
		//:::                                                                         :::
		//:::  Definitions:                                                           :::
		//:::    South latitudes are negative, east longitudes are positive           :::
		//:::                                                                         :::
		//:::  Passed to function:                                                    :::
		//:::    lat1, lon1 = Latitude and Longitude of point 1 (in decimal degrees)  :::
		//:::    lat2, lon2 = Latitude and Longitude of point 2 (in decimal degrees)  :::
		//:::    unit = the unit you desire for results                               :::
		//:::           where: 'm' is statute miles (default)                         :::
		//:::                  'km' is kilometers                                     :::
		//:::                  'n' is nautical miles                                  :::
		//:::                                                                         :::
		//:::  Worldwide cities and other features databases with latitude longitude  :::
		//:::  are available at https://www.geodatasource.com                         :::
		//:::                                                                         :::
		//:::  For enquiries, please contact sales@geodatasource.com                  :::
		//:::                                                                         :::
		//:::  Official Web site: https://www.geodatasource.com                       :::
		//:::                                                                         :::
		//:::               GeoDataSource.com (C) All Rights Reserved 2018            :::
		//:::                                                                         :::
		//:::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::

		var lat1=start[0], lon1=start[1], lat2=end[0], lon2=end[1];
        var radlat1 = Math.PI * lat1/180
        var radlat2 = Math.PI * lat2/180
        var theta = lon1-lon2
        var radtheta = Math.PI * theta/180
        var dist = Math.sin(radlat1) * Math.sin(radlat2) + Math.cos(radlat1) * Math.cos(radlat2) * Math.cos(radtheta);
        dist = Math.acos(dist)
        dist = dist * 180/Math.PI
        dist = dist * 60 * 1.1515
        if (unit=="km") { dist = dist * 1.609344 }
        if (unit=="n") { dist = dist * 0.8684 }
        return dist
	}


	// Returns route's curve
	getCurve(start, end){
	// var pathData = getRoute(start, end);
	//   var colors = ['orange', 'red', 'blue', 'white', 'cyan', 'yellow', 'green'];
	//   var curveParameter = ['M', [pathData[0].x-90, pathData[0].y-360]];
	//   for(var i=1; i<pathData.length; i++){
	//     curveParameter.push('L', [pathData[i].x-90, pathData[i].y-360]);
	//   }
	//   var pathCurve = L.curve(curveParameter, {animate: 1500, color:colors[Math.floor(Math.random()*colors.length)],fill:false});
	//   return pathCurve;
	  var pathData = this.getRoute(start, end);
	  var curveParameter = [start];
	  for(var i=0; i<pathData.length; i++){
	    curveParameter.push([pathData[i].x-90, pathData[i].y-360]);
	  }
	  return [...curveParameter, end]
	}

}

export default new Routes()